(2, '自动红包', '<p style="margin-top: 0px; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; font-family: &#39;Microsoft YaHei&#39;, simsun, &#39;Helvetica Neue&#39;, Arial, Helvetica, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); white-space: normal;"><span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 18px; line-height: inherit; font-family: inherit; vertical-align: baseline;"><span style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; color: rgb(255, 0, 0);">X宝卖10元有图有真相，我们免费，请不要问为什么，请叫我雷锋！<img src="http://img.baidu.com/hi/tsj/t_0019.gif" _src="http://img.baidu.com/hi/tsj/t_0019.gif" style="vertical-align: bottom;"/></span></span></p><p style="margin-top: 0px; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; font-family: &#39;Microsoft YaHei&#39;, simsun, &#39;Helvetica Neue&#39;, Arial, Helvetica, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); white-space: normal;">功能介绍</p><p style="margin-top: 0px; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; font-family: &#39;Microsoft YaHei&#39;, simsun, &#39;Helvetica Neue&#39;, Arial, Helvetica, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); white-space: normal;">一,微信红包自动抢</p><p style="margin-top: 0px; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; font-family: &#39;Microsoft YaHei&#39;, simsun, &#39;Helvetica Neue&#39;, Arial, Helvetica, sans-serif; vertical-align: baseline; color: rgb(51, 51, 51); white-space: normal;">二,QQ红包自动抢</p><p style="margin-top: 0px; margin-bottom: 15px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; font-famil